Contents are exactly what the title conjures up.

This is an English title translated into French, which may seem like an odd thing to post, but the reason behind it is simply that this release is higher-quality than any of the native-language ones. And if the story and dialogue are as inane as those of the majority of other erotic comics I posted lately, even a bad translation can't do much to make those any worse, I'm thinking - plus for those who don't read French but would ignore the text even if it were in English, it hardly matters in any case! :P
